css:
@-moz-document url-prefix(http://api.highcharts.com) {
#nav .tree,
#nav .tree * {
    font-family: "Calibri";
    font-size: 1.03em;
}
.member.hilighted {
    background-color: #000000;
}
* {
    color: #e2e2e2;
}
.demo>h4 {
    display: none;
}
.member {
    padding: 10px 15px 5px 15px;
    ;
    overflow-y: hidden;
    position: relative;
    border-top: 1px solid silver;
}
.section .demo,
.member .demo {
    font-style: italic;
    margin-top: 0.5em;
    margin-bottom: 0.5em;
    margin-left: 0.5em;
}
* {
    font-family: 'Roboto', sans-serif;
    line-height: 1.2;
    
    background: #2B2B2B;
}
.tree a {
    color: #dedede;
}
.member .description {
    color: #dedede;
}
.member .title,
.member .title a,
.member .returnType {
    color: #f7a3a3;
}
.description code {
    color: #ffa13e;
    font-weight: normal;
}
#nav .value-number {
    color: #81d5ff;
}
#nav .value-string,
#nav .value-color {
    color: #88e282;
}
a {
    color: #6cbbd4;
    text-decoration: none;
    font-weight: normal;
}
a.hilighted {
    background-color: #9a5a0e;
}
#nav .plus {
    font-family: FontAwesome !important;
    color: whitesmoke;
}
.section h1 {
    margin: 0px;
    font-family: "Tahoma";
}
#nav code {
    color: #ffbdbd;
    font-weight: normal;
    font-family: "Lucida Console";
}
.member .title, .member .title a, .member .returnType {
    color: #ffbdbd;
    font-weight: normal;
    font-family: "Lucida Console";
}
}
